import React from 'react';
import Form from 'react-bootstrap/Form';

const workoutSessionCreate = props => {
    const form = (
        <Form>
            <Form.Group controlId="weight">
                <Form.Label>Weight</Form.Label>
                <Form.Control type="email" placeholder="Enter weight" />
            </Form.Group>
            <Form.Group controlId="unit">
                <Form.Label className="my-1 mr-2" htmlFor="unitselect">Unit</Form.Label>
                <Form.Control
                    as="select"
                    className="my-1 mr-sm-2"
                    id="unitselect"
                    custom
                >
                    <option value="0">Choose...</option>
                    <option value="1">One</option>
                    <option value="2">Two</option>
                    <option value="3">Three</option>
                </Form.Control>
            </Form.Group>
        </Form>
    );
    return (
    <div>
        { form }
    </div>
    );
};

export default workoutSessionCreate;
